import React from "react";

import "./AdminPage.css";
import { useNavigate } from "react-router-dom";

const AdminPage = () => {
    const navigate=useNavigate();
    const handleUsers=()=>{
      navigate("/userList")
    };


  return (
    <>
    <div className="admin-container">
    
      {/* Admin Features Section */}
      <div className="admin-features">
        {/* Card 1 */}
        <div className="admin-card">
          <h3>Manage Users</h3>
          <p>
            Easily manage your users records, track details, and maintain an
            up-to-date roster.
          </p>
          <button className="admin-btn" onClick={handleUsers}>View Users</button>
        </div>

        {/* Card 2 */}
        <div className="admin-card">
          <h3>Track Tasks</h3>
          <p>
            Organize your companyâ€™s structure with detailed information on each
            department.
          </p>
          <button className="admin-btn">View Departments</button>
        </div>

        {/* Card 3 */}
        <div className="admin-card">
          <h3>Analyze Growth</h3>
          <p>
            Use our comprehensive dashboard to analyze employee growth and
            organizational structure.
          </p>
          <button className="admin-btn">Go to Dashboard</button>
        </div>
      </div>
    </div>
    </>
  );
};

export default AdminPage;
